INSERT INTO `hpc_application` VALUES (1,'Bowtie2','https://sourceforge.net/projects/bowtie-bio/files/bowtie2/2.3.4.3',1,'Bowtie is an ultrafast, memory-efficient short read aligner geared toward quickly aligning large sets of short DNA sequences (reads) to large genomes. It aligns 35-base-pair reads to the human genome at a rate of 25 million reads per hour on a typical workstation. Bowtie indexes the genome with an FM Index to keep its memory footprint small: for the human genome, the index is typically about 2.2 GB (for unpaired alignment) or 2.9 GB (for paired-end or colorspace alignment). Multiple processors can be used simultaneously to achieve greater alignment speed. Bowtie can also output alignments in the standard SAM format, allowing Bowtie to interoperate with other tools supporting SAM, including the SAMtools consensus, SNP, and indel callers. Bowtie runs on the command line under Windows, Mac OS X, Linux, and Solaris.',4,1,'shared'),(2,'Blast ','ftp://ftp.ncbi.nlm.nih.gov/blast/executables/blast+/LATEST/  ',1,'The Basic Local Alignment Search Tool (BLAST) finds regions of local similarity between sequences. The program compares nucleotide or protein sequences to sequence databases and calculates the statistical significance of matches. BLAST can be used to infer functional and evolutionary relationships between sequences as well as help identify members of gene families. ',4,1,'shared'),(3,'ORNA','https://github.com/SchulzLab/ORNA',1,'ORNA is a read normalization software developed in spirit of Diginorm. ORNA is computationally inexpensive and it guarantees the preservation of all kmers from the original dataset. It can be used if the user has a high coverage dataset but does not have enough computational power (in particular memory but also limited time) in order to conduct a de novo assembly, because it removes the redundancy in your data. It can also be used to merge many sequencing datasets. The user must be aware that using ORNA (or in that case any normalization software) might have a significant impact on the assemblies produced as it is highly dependent on the dataset.',4,1,'shared'),(4,'SRA toolkit ','˙https://github.com/ncbi/sra-tools/wiki/Downloads',1,'The SRA Toolkit and SDK from NCBI is a collection of tools and libraries for using data in the INSDC Sequence Read Archives.',4,1,'shared'),(5,'Simka ','https://github.com/GATB/simka',1,'Simka is a de novo comparative metagenomics tool. Simka represents each dataset as a k-mer spectrum and compute several classical ecological distances between them.',4,1,'shared'),(6,'Spades','http://cab.spbu.ru/software/spades/',1,'SPAdes ? St. Petersburg genome assembler ? is an assembly toolkit containing various assembly pipelines',4,1,'shared'),(7,'Metaphlan2','https://bitbucket.org/biobakery/metaphlan2',1,'MetaPhlAn is a computational tool for profiling the composition of microbial communities (Bacteria, Archaea, Eukaryotes and Viruses) from metagenomic shotgun sequencing data (i.e. not 16S) with species-level. With the newly added StrainPhlAn module, it is now possible to perform accurate strain-level microbial profiling.',4,1,'shared'),(8,'Prodigal','https://github.com/hyattpd/Prodigal/wiki/installation#installing-on-generic-unix ',1,'Prodigal is a protein-coding gene prediction software tool for bacterial and archaeal genomes. The acronym stands for PROkaryotic DYnamic Programming Genefinding ALgorithm. ',4,1,'shared'),(9,'Megahit','https://github.com/voutcn/megahit/releases',1,'MEGAHIT: An ultra-fast single-node solution for large and complex metagenomics assembly via succinct de Bruijn graph ',4,1,'shared'),(10,'MetaBat2','https://anaconda.org/ursky/metabat2',1,'MetaBAT2 takes a metagenome assembly and the reads that produced the assembly and organizes the contigs into putative genomes, called \"bins\"\".\"',4,1,'shared'),(11,'Checkm','https://github.com/Ecogenomics/CheckM/wiki/Installation',1,'CheckM provides a set of tools for assessing the quality of genomes recovered from isolates, single cells, or metagenomes. It provides robust estimates of genome completeness and contamination by using collocated sets of genes that are ubiquitous and single-copy within a phylogenetic lineage. Assessment of genome quality can also be examined using plots depicting key genomic characteristics (e.g., GC, coding density) which highlight sequences outside the expected distributions of a typical genome. CheckM also provides tools for identifying genome bins that are likely candidates for merging based on marker set compatibility, similarity in genomic characteristics, and proximity within a reference genome tree.',4,1,'shared'),(12,'CD-hit˙','https://github.com/weizhongli/cdhit/releases',1,'CD-HIT is a widely used program for clustering biological sequences to reduce sequence redundancy and improve the performance of other sequence analyses. ',4,1,'shared'),(13,'DEMIC ','https://sourceforge.net/projects/demic/',1,'DEMIC is a computational tool for comparing bacterial growth rates between metagenomic samples, based on inferred relative distances of contigs from replication origin according to their coverages.',4,1,'shared'),(14,'Fastqc','https://www.bioinformatics.babraham.ac.uk/projects/download.html#fastqc',1,'FastQC is a program designed to spot potential problems in high througput sequencing datasets. It runs a set of analyses on one or more raw sequence files in fastq or bam format and produces a report which summarises the results.',4,1,'shared'),(15,'Sickle ','https://github.com/najoshi/sickle',1,'sickle - A windowed adaptive trimming tool for FASTQ files using quality',4,1,'shared'),(16,'Krona ','https://github.com/marbl/Krona/wiki/Downloads',1,'Krona is a flexible tool for exploring the relative proportions of hierarchical data, such as metagenomic classifications, using a radial, space-filling display. It is implemented using HTML5 and JavaScript, allowing charts to be explored locally or served over the Internet, requiring only a current version of any major web browser. Krona charts can be created using an Excel template or from common bioinformatics formats using the provided conversion scripts.                                                                           Krona allows hierarchical data to be explored with zooming, multi-layered pie charts. Krona charts can be created using an Excel template or KronaTools, which includes support for several bioinformatics tools and raw data formats. The interactive charts are self-contained and can be viewed with any modern web browser',4,1,'shared'),(17,'samtools ','https://github.com/samtools/samtools',1,'Tools (written in C using htslib) for manipulating next-generation sequencing data',4,1,'shared'),(18,'HUMAnN2','https://bitbucket.org/biobakery/biobakery/wiki/humann2',0,'HUMAnN2 (the HMP Unified Metabolic Analysis Network) is a method for efficiently and accurately determining the presence, absence, and abundance of metabolic pathways in a microbial community from metagenomic or metatranscriptomic sequencing data. It is appropriate for any type of microbial community shotgun sequence profiling (i.e. not just the human microbiome; the name is a historical product of its origin in a Human Microbiome Project working group).',4,1,'shared'),(19,'mothur','https://www.mothur.org/wiki/Installation ',0,' mothur is currently the most cited bioinformatics tool for analyzing 16S rRNA gene sequences.',4,1,'shared'),(20,'QIIME 2','https://docs.qiime2.org/2018.11/install/',0,'QIIME 2 is a powerful, extensible, and decentralized microbiome analysis package with a focus on data and analysis transparency. QIIME 2 enables researchers to start an analysis with raw DNA sequence data and finish with publication-quality figures and statistical results.',4,1,'shared'),(21,'bwa','https://github.com/lh3/bwa',0,'BWA is a software package for mapping DNA sequences against a large reference genome, such as the human genome. It consists of three algorithms: BWA-backtrack, BWA-SW and BWA-MEM. The first algorithm is designed for Illumina sequence reads up to 100bp, while the rest two for longer sequences ranged from 70bp to a few megabases. BWA-MEM and BWA-SW share similar features such as the support of long reads and chimeric alignment,',4,1,'shared'),(22,'Trimmomatic','http://www.usadellab.org/cms/?page=trimmomatic',0,'Trimmomatic: A flexible read trimming tool for Illumina NGS data',4,1,'shared'),(23,'PICRUSt','http://picrust.github.io/picrust/',0,'The PICRUSt project aims to support prediction of the unobserved character states in a community of organisms from phylogenetic information about the organisms in that community. The primary application is to predict gene family abundance (e.g. the metagenome) in environmental DNA samples for which only marker gene (e.g. 16S rRNA gene) data are available.',4,1,'shared'),(24,'BioPerl','https://bioperl.org/',1,'BioPerl is a project for development of free and open source Perl tools for computational molecular biology. For example, it includes classes for biological sequences, readers of multiple formats, sequence alignments, database searching objects, and interfaces to multiple programs such as EMBOSS, ClustalW, and BLAST.',4,1,'shared'),(25,'HMMER','http://hmmer.org/',1,'HMMER is used for searching sequence databases for sequence homologs, and for making sequence alignments. It implements methods using probabilistic models called profile hidden Markov models (profile HMMs). ',4,1,'shared'),(26,'PROKKA','http://www.vicbioinformatics.com/software.prokka.shtml',1,'Prokka is a software tool for the rapid annotation of prokaryotic genomes. A typical 4 Mbp genome can be fully annotated in less than 10 minutes on a quad-core computer, and scales well to 32 core SMP systems. It produces GFF3, GBK and SQN files that are ready for editing in Sequin and ultimately submitted to Genbank/DDJB/ENA. ',4,1,'shared'),(27,'pplacer','https://matsen.fhcrc.org/pplacer/',1,'Pplacer places query sequences on a fixed reference phylogenetic tree to maximize phylogenetic likelihood or posterior probability according to a reference alignment. Pplacer is designed to be fast, to give useful information about uncertainty, and to offer advanced visualization and downstream analysis.',4,1,'shared'),(28,'HTSlib ','http://www.htslib.org/',1,'HTSlib is a C library used for reading and writing high-throughput sequencing data. HTSlib is the core library used by SAMtools. HTSlib also provides the bgzip, htsfile, and tabix utilities.',4,1,'shared'),(29,'GATE','https://gate.ac.uk',1,'GATE (General Architecture for Text Engineering) est une infrastructure développée par luniversité de Sheffield, dédiée ŕ lextraction dinformation composée dune architecture, dune interface dAPI, et dun environnement de programmation graphique.\nSon systčme dextraction ANNIE dispose lui-męme de plusieurs modules : analyseur lexical, analyseur syntaxique, extracteur dentités nommées, gestionnaire de listes de termes par type sémantique (gazeeters),',1,1,'shared'),(30,'cp2k','https://www.cp2k.org/',1,'CP2K is a quantum chemistry and solid state physics software package that can perform atomistic simulations of solid state, liquid, molecular, periodic, material, crystal, and biological systems. CP2K provides a general framework for different modeling methods such as DFT using the mixed Gaussian and plane waves approaches GPW and GAPW. Supported theory levels include DFTB, LDA, GGA, MP2, RPA, semi-empirical methods (AM1, PM3, PM6, RM1, MNDO, ?), and classical force fields (AMBER, CHARMM, ?). CP2K can do simulations of molecular dynamics, metadynamics, Monte Carlo, Ehrenfest dynamics, vibrational analysis, core level spectroscopy, energy minimization, and transition state optimization using NEB or dimer method. (Detailed overview of features.)',2,1,'shared'),(31,'lammps','https://lammps.sandia.gov/',1,'LAMMPS is a classical molecular dynamics code with a focus on materials modeling. It\'s an acronym for Large-scale Atomic/Molecular Massively Parallel Simulator. ',2,1,'shared'),(32,'yambo','http://www.yambo-code.org/download/index.php',1,'Yambo is a FORTRAN/C code for Many-Body calculations in solid state and molecular physics. Yambo relies on the Kohn-Sham wavefunctions generated by two DFT public codes: abinit, and PWscf. The code was originally developed in the Condensed Matter Theoretical Group of the Physics Department at the University of Rome \"Tor Vergata\"\" by Andrea Marini. Previous to its release under the GPL license',0,1,'1'),(33,'uspex','https://uspex-team.org/en/uspex/downloads',0,'USPEX (Universal Structure Predictor: Evolutionary Xtallography...and in Russian \"uspekh\"\" means \"\"success\"\" - owing to the high success rate and many useful results produced by this method) is a method developed by the Oganov laboratory since 2004. The problem of crystal structure prediction is very old and does',0,0,'2'),(34,'Quantum ESPRESSO','https://www.quantum-espresso.org/',1,'Quantum ESPRESSO is an integrated suite of Open-Source computer codes for electronic-structure calculations and materials modeling at the nanoscale. It is based on density-functional theory, plane waves, and pseudopotential',2,1,'shared'),(35,'AutoDock Vina','http://vina.scripps.edu/',1,'AutoDock Vina is an open-source program for doing molecular docking. It was designed and implemented by Dr. Oleg Trott in the Molecular Graphics Lab at The Scripps Research Institute. ',2,1,'shared'),(36,'GROMACS','http://www.gromacs.org/',1,'GROMACS is a versatile package to perform molecular dynamics, i.e. simulate the Newtonian equations of motion for systems with hundreds to millions of particles.',2,1,'shared'),(37,'Wien2k','http://susi.theochem.tuwien.ac.at/index.html',0,'WIEN2k est un programme informatique crit en Fortran permettant d\'effectuer des calculs quantiques sur les solides priodiques. WIEN2k utilise la mthode full-potential augmented plane-wave and local-orbitals [FP-APW+lo] pour rsoudre les quations de Kohn-Sham de la thorie de la fonctionnelle de la densit.',2,2,'shared'),(38,'Molpro','https://www.molpro.net/?portal=user&choice=Introduction',0,'Molpro is a comprehensive system of ab initio programs for advanced molecular electronic structure calculations, designed and maintained by H.-J. Werner and P. J. Knowles, and containing contributions from many other authors. It comprises efficient and well parallelized programs for standard computational chemistry applications, such as DFT with a large choice of functionals, as well as state-of-the art high-level coupled-cluster and multi-reference wave function methods.',2,2,'shared'),(39,'Gaussian','http://gaussian.com/',0,'GAUSSIAN est un logiciel de chimie numrique, cr  l\'origine par John Pople et sorti en 1970. Il a t depuis sans cesse mis  jour. Le nom vient de l\'utilisation par Pople d\'orbitales gaussiennes pour acclrer le calcul par rapport aux logiciels utilisant des orbitales de Slater.',2,2,'shared'),(40,'OpenMC','https://openmc.readthedocs.io/en/stable/',0,'OpenMC is a Monte Carlo particle transport simulation code focused on neutron criticality calculations. It is capable of simulating 3D models based on constructive solid geometry with second-order surfaces. OpenMC supports either continuous-energy or multi-group transport. The continuous-energy particle interaction data is based on a native HDF5 format that can be generated from ACE files used by the MCNP and Serpent Monte Carlo codes.',2,1,'shared'),(41,'ORCA','https://sites.google.com/site/orcainputlibrary/setting-up-orca',1,'ORCA is a flexible, efficient and easy-to-use general purpose tool for quantum chemistry  with specific emphasis on spectroscopic properties of open-shell molecules.   It features a wide variety of standard quantum chemical methods ranging from semiempirical methods to DFT to single and multireference correlated ab initio methods.  It can also treat environmental and relativistic effects.',2,1,'shared'),(42,'Siesta ','https://departments.icmab.es/leem/siesta/',1,'SIESTA is both a method and its computer program implementation, to perform efficient electronic structure calculations and ab initio molecular dynamics simulations of molecules and solids. SIESTA\'s efficiency stems from the use of strictly localized basis sets and from the implementation of linear-scaling algorithms which can be applied to suitable systems. A very important feature of the code is that its accuracy and cost can be tuned in a wide range, from quick exploratory calculations to highly accurate simulations matching the quality of other approaches, such as plane-wave and all-electron methods. ',2,1,'shared'),(43,'GAMESS','https://www.msg.chem.iastate.edu/gamess/',0,'The General Atomic and Molecular Electronic Structure System (GAMESS) is a general ab initio quantum chemistry package',2,1,'shared'),(44,'openbabel','https://openbabel.org/docs/dev/Installation/install.html',0,'Open Babel is a chemical toolbox designed to speak the many languages of chemical data. It\'s an open, collaborative project allowing anyone to search, convert, analyze, or store data from molecular modeling, chemistry, biochemistry, or related areas',2,1,'shared'),(45,'colvars','https://colvars.github.io/',0,'A software module for molecular simulation programs, which provides a flexible and high-performance platform for present and future algorithms',2,1,'shared'),(46,'Material Studio','https://www.3dsbiovia.com/products/collaborative-science/biovia-materials-studio/',0,'Materials Studio is a complete modeling and simulation environment designed to allow researchers in materials science and chemistry to predict and understand the relationships of a material?s atomic and molecular structure with its properties and behavior. ',2,2,'shared'),(47,'GEANT4','https://geant4.web.cern.ch/',1,'Geant4 is a toolkit for the simulation of the passage of particles through matter. Its areas of application include high energy, nuclear and accelerator physics, as well as studies in medical and space science. ',1,1,'shared'),(48,'Quantum wise','https://docs.quantumwise.com/tutorials/tutorials.html',0,'QuantumATK packages a powerful set of tools for calculating properties of nano-scale systems. These atomic-scale simulators, in QuantumATK denoted calculators, are based on density functional theory, semi-empirical tight binding, and classical potentials. The non-equilibrium Green?s function method is a unique feature of QuantumATK; it allows simulations on nano-scale devices and interfaces, including support for non-zero bias between the electrode leads and device components such as electrostatic gates and dielectrics.',2,2,'shared'),(49,'AkaiKKR','http://kkr.issp.u-tokyo.ac.jp/',1,'AkaiKKR (MACHIKANEYAMA) is a program package used for first-principles calculation of electronic structures of metals, semiconductors and compounds, in the framework of the local density approximation or generalized gradient approximation (LDA/GGA) of the density functional theory.',2,1,'shared'),(50,'Abinit','https://www.abinit.org/',1,'ABINIT is a software suite to calculate the optical, mechanical, vibrational, and other observable properties of materials. Starting from the quantum equations of density functional theory, you can build up to advanced applications with perturbation theories based on DFT, and many-body Green\'s functions ',2,1,'shared'),(51,'GCC','https://gcc.gnu.org/',1,'The GNU Compiler Collection includes front ends for C, C++, Objective-C, Fortran, Ada, Go, and D, as well as libraries for these languages (libstdc++,...). GCC was originally written as the compiler for the GNU operating system. The GNU system was developed to be 100% free software, free in the sense that it respects the user\'s freedom.',7,1,'shared'),(52,'R','https://www.r-project.org/',1,'R is a free software environment for statistical computing and graphics. It compiles and runs on a wide variety of UNIX platforms, Windows and MacOS.',7,1,'shared'),(53,'ROOT','https://root.cern.ch/',1,'Root A modular scientific software toolkit. It provides all the functionalities needed to deal with big data processing, statistical analysis, visualisation and storage. It is mainly written in C++ but integrated with other languages such as Python and R.',7,1,'shared'),(54,'IntelŠ Parallel Studio XE','https://software.intel.com/en-us/parallel-studio-xe',1,'Intel Parallel Studio est un logiciel propritaire dvelopp par Intel. Il permet de dvelopper des logiciels en C++ et Fortran. Son avantage est qu\'il renforce les performances des logiciels tout en demandant le moins d?effort sur les processeurs.',7,1,'shared'),(55,'CUDA toolkit','https://developer.nvidia.com/cuda-toolkit',1,'The NVIDIAŠ CUDAŠ Toolkit provides a development environment for creating high performance GPU-accelerated applications. With the CUDA Toolkit, you can develop, optimize and deploy your applications on GPU-accelerated embedded systems, desktop workstations, enterprise data centers, cloud-based platforms and HPC supercomputers. The toolkit includes GPU-accelerated libraries, debugging and optimization tools, a C/C++ compiler and a runtime library to deploy your application.',7,1,'shared'),(56,'ArrayFire','https://github.com/arrayfire/arrayfire                                                                                                        https://arrayfire.com/',1,'ArrayFire is a general-purpose library that simplifies the process of developing software that targets parallel and massively-parallel architectures including CPUs, GPUs, and other hardware acceleration devices.',7,1,'shared'),(57,'scala','https://www.scala-lang.org/',1,'Scala is a programming language for general software applications. Scala has full support for functional programming and a very strong static type system. This allows programs written in Scala to be very concise and thus smaller in size than other general-purpose programming languages. Scala source code is intended to be compiled to Java bytecode, so that the resulting executable code runs on a Java virtual machine. Java libraries may be used directly in Scala code and vice versa. Scala is object-oriented, and uses a curly-brace syntax. Scala has many features of functional programming languages, including currying, type inference, immutability, lazy evaluation, and pattern matching. It also has an advanced type system supporting algebraic data types, covariance and contravariance, higher-order types, and anonymous types. Other features of Scala include operator overloading, optional parameters, named parameters, raw strings, and no checked exceptions.',7,1,'shared'),(58,'openmpi','https://www.open-mpi.org/',1,'The Open MPI Project is an open source Message Passing Interface implementation that is developed and maintained by a consortium of academic, research, and industry partners. Open MPI is therefore able to combine the expertise, technologies, and resources from all across the High Performance Computing community in order to build the best MPI library available. Open MPI offers advantages for system and software vendors, application developers and computer science researchers.',7,1,'shared'),(59,'vnl','https://vxl.github.io/',0,'VXL (the Vision-something-Libraries) is a collection of C++ libraries designed for computer vision research and implementation. It was created from TargetJr and the IUE with the aim of making a light, fast and consistent system. VXL is written in ANSI/ISO C++ and is designed to be portable over many platforms. The core libraries in VXL are:      vnl (numerics): Numerical containers and algorithms. e.g. matrices, vectors, decompositions, optimisers.     vil (imaging): Loading, saving and manipulating images in many common file formats, including very large images.     vgl (geometry): Geometry for points, curves and other elementary objects in 1, 2 or 3 dimensions.     vsl (streaming I/O), vbl (basic templates), vul (utilities): Miscellaneous platform-independent functionality. ',7,1,'shared'),(60,'Bison','https://www.gnu.org/software/bison/',1,'Bison is a general-purpose parser generator that converts an annotated context-free grammar into a deterministic LR or generalized LR (GLR) parser employing LALR(1) parser tables. As an experimental feature, Bison can also generate IELR(1) or canonical LR(1) parser tables. Once you are proficient with Bison, you can use it to develop a wide range of language parsers, from those used in simple desk calculators to complex programming languages',7,1,'shared'),(61,'Boost','https://github.com/boostorg/boost/wiki',1,'The Boost project provides free peer-reviewed portable C++ source libraries.',7,1,'shared'),(62,'Bonnie++','http://bonnie.sourceforge.net/',1,' Bonnie++ is a toolkit for testing hard drive and file system performance.',7,1,'shared'),(63,'Global Arrays','https://github.com/GlobalArrays/ga/wiki',1,'Global Arrays (GA) is a Partitioned Global Address Space (PGAS) programming model. It provides primitives for one-sided communication (Get, Put, Accumulate) and Atomic Operations (read increment). It supports blocking and non-blocking primtives, and supports location consistency.',7,1,'shared'),(64,'Golang','https://golang.org/',1,'Go is an open source programming language that makes it easy to build simple, reliable, and efficient software. ',7,1,'shared'),(65,'Slurm','https://slurm.schedmd.com/documentation.html',1,'Slurm is an open source, fault-tolerant, and highly scalable cluster management and job scheduling system for large and small Linux clusters. Slurm requires no kernel modifications for its operation and is relatively self-contained.',7,1,'shared'),(66,'Cmake','https://cmake.org/',1,'CMake is an open-source, cross-platform family of tools designed to build, test and package software. CMake is used to control the software compilation process using simple platform and compiler independent configuration files, and generate native makefiles and workspaces that can be used in the compiler environment of your choice. ',7,1,'shared'),(67,'Singularity','https://singularity.lbl.gov/',1,'Singularity is an open source container platform designed to be simple, fast, and secure. Singularity is optimized for EPC and HPC workloads, allowing untrusted users to run untrusted containers in a trusted way.',7,1,'shared'),(68,'Xerces-C++','https://xerces.apache.org/xerces-c/',1,'Xerces-C++ is a validating XML parser written in a portable subset of C++. Xerces-C++ makes it easy to give your application the ability to read and write XML data. A shared library is provided for parsing, generating, manipulating, and validating XML documents using the DOM, SAX, and SAX2 APIs.',7,1,'shared'),(69,'Torque','https://github.com/adaptivecomputing/torque',1,'The Terascale Open-source Resource and QUEue Manager (TORQUE)[5] is a distributed resource manager providing control over batch jobs and distributed compute nodes. ',7,1,'shared'),(70,'Readline','https://tiswww.case.edu/php/chet/readline/rltop.html',1,'The GNU Readline library provides a set of functions for use by applications that allow users to edit command lines as they are typed in. Both Emacs and vi editing modes are available. The Readline library includes additional functions to maintain a list of previously-entered command lines, to recall and perhaps reedit those lines, and perform csh-like history expansion on previous commands. ',7,1,'shared'),(71,'netcdf','https://www.unidata.ucar.edu/software/netcdf/',1,'NetCDF (Network Common Data Form) is a set of interfaces for array-oriented data access and a freely distributed collection of data access libraries for C, Fortran, C++, Java, and other languages. The netCDF libraries support a machine-independent format for representing scientific data. Together, the interfaces, libraries, and format support the creation, access, and sharing of scientific data.',7,1,'shared'),(72,'Iozone','http://www.iozone.org/',1,'IOzone is a filesystem benchmark tool. The benchmark generates and measures a variety of file operations. Iozone has been ported to many machines and runs under many operating systems. ',7,1,'shared'),(73,'cm-EasyBuild','https://easybuild.readthedocs.io/en/latest/',1,' EasyBuild, a software build and installation framework that allows you to manage (scientific) software on High Performance Computing (HPC) systems in an efficient way.',7,1,'shared'),(74,'VTK','https://vtk.org/',1,'The Visualization Toolkit (VTK) is open source software for manipulating and displaying scientific data. It comes with state-of-the-art tools for 3D rendering, a suite of widgets for 3D interaction, and extensive 2D plotting capability.',7,1,'shared'),(75,'HDF5','https://www.hdfgroup.org/solutions/hdf5/',1,'High-performance data management and storage suite  Utilize the HDF5 high performance data software library and file format to manage, process, and store your heterogeneous data. HDF5 is built for fast I/O processing and storage. ',7,1,'shared'),(76,'hwloc','https://www.open-mpi.org/projects/hwloc/',1,'The Portable Hardware Locality (hwloc) software package provides a portable abstraction (across OS, versions, architectures, ...) of the hierarchical topology of modern architectures, including NUMA memory nodes, sockets, shared caches, cores and simultaneous multithreading. It also gathers various system attributes such as cache and memory information as well as the locality of I/O devices such as network interfaces, InfiniBand HCAs or GPUs. ',7,1,'shared'),(77,'MPICH','https://www.mpich.org/',1,'MPICH is a high performance and widely portable implementation of the Message Passing Interface (MPI) standard.',7,1,'shared'),(78,'mpiexec','https://www.open-mpi.org/doc/v3.0/man1/mpiexec.1.php',1,'mpiexec - Execute serial and parallel jobs in Open MPI. oshrun, shmemrun - Execute serial and parallel jobs in Open SHMEM.',7,1,'shared'),(79,'mvapich','http://mvapich.cse.ohio-state.edu/',1,'MVAPICH, also known as MVAPICH2, is a BSD-licensed implementation of the MPI standard developed by Ohio State University.[1][2] MVAPICH comes in a number of flavors:      MVAPICH2, with support for InfiniBand, iWARP, RoCE, and Intel Omni-Path     MVAPICH2-X, with support for PGAS and OpenSHMEM     MVAPICH2-GDR, with support for InfiniBand and NVIDIA CUDA GPUs     MVAPICH2-MIC, with support for InfiniBand and Intel MIC     MVAPICH2-Virt, with support for InfiniBand and SR-IOV     MVAPICH2-EA, which is energy-aware and supports InfiniBand, iWARP, and RoCE',7,1,'shared'),(80,'qt','https://www.qt.io/',1,'Qt : une API oriente objet et dveloppe en C++, conjointement par The Qt Company et Qt Project. Qt offre des composants d\'interface graphique, d\'accs aux donnes, de connexions rseaux, de gestion des fils d\'excution, d\'analyse XML,',7,1,'shared'),(81,'ITK','https://itk.org/',1,'ITK is an open-source, cross-platform system that provides developers with an extensive suite of software tools for image analysis.˙ Developed through extreme programming methodologies, ITK employs leading-edge algorithms for registering and segmenting multidimensional data.',7,1,'shared'),(82,'Anaconda','https://www.anaconda.com/',1,'The open-source Anaconda Distribution is the easiest way to perform Python/R data science and machine learning on Linux, Windows, and Mac OS X.  it is the industry standard for developing, testing, and training on a single machine, enabling individual data scientists to: ? Quickly download 1,500+ Python/R data science packages ? Manage libraries, dependencies, and environments with Conda ? Develop and train machine learning and deep learning models with scikit-learn, TensorFlow, and Theano ? Analyze data with scalability and performance with Dask, NumPy, pandas, and Numba ? Visualize results with Matplotlib, Bokeh, Datashader, and Holoviews ',6,1,'shared'),(83,'Apache spark','https://spark.apache.org/',0,'Apache Spark is a fast and general-purpose cluster computing system. It provides high-level APIs in Java, Scala, Python and R, and an optimized engine that supports general execution graphs. It also supports a rich set of higher-level tools including Spark SQL for SQL and structured data processing, MLlib for machine learning, GraphX for graph processing, and Spark Streaming.',6,1,'shared'),(84,'kafka','https://kafka.apache.org/',0,'Kafka is used for building real-time data pipelines and streaming apps. It is horizontally scalable, fault-tolerant, wicked fast, and runs in production in thousands of companies.',6,1,'shared'),(85,'MLlib','https://spark.apache.org/mllib/',0,'machine learning  \"MLlib\"\"is Apache Spark\'s scalable machine learning library.\"',6,1,'shared'),(86,'deeplearning4j ','https://deeplearning4j.org',0,'DL4J takes advantage of the latest distributed computing frameworks including Apache Spark and Hadoop to accelerate training. On multi-GPUs, it is equal to Caffe in performance.                                                                       The Deep Learning algorithms are generally built with a series of Neural Networks Machine Learning algorithms stacked onto one another. ',6,1,'shared'),(87,'Keras ','https://keras.io/',1,'Keras is a high-level neural networks API, written in Python and capable of running on top of TensorFlow, CNTK, or Theano.',6,1,'local'),(88,'Tensorflow','https://www.tensorflow.org/',1,'TensorFlow is an open source software library for numerical computation using data flow graphs. The graph nodes represent mathematical operations, while the graph edges represent the multidimensional data arrays (tensors) that flow between them. This flexible architecture enables you to deploy computation to one or more CPUs or GPUs in a desktop, server, or mobile device without rewriting code. TensorFlow also includes TensorBoard, a data visualization toolkit.',6,1,'local'),(89,'cuDNN','https://developer.nvidia.com/cudnn',1,'The NVIDIA CUDAŠ Deep Neural Network library (cuDNN) is a GPU-accelerated library of primitives for deep neural networks. cuDNN provides highly tuned implementations for standard routines such as forward and backward convolution, pooling, normalization, and activation layers. ',6,3,'shared'),(90,'SCILAB','https://www.scilab.org/',1,'SCILAB est un logiciel libre de calcul numrique multi-plateforme fournissant un environnement de calcul pour des applications scientifiques. Il possde un langage de programmation orient calcul numrique de haut niveau. Il peut tre utilis pour le traitement du signal, l?analyse statistique, le traitement d?images, les simulations de dynamique des fluides, l?optimisation numrique, et la modlisation et simulation de systmes dynamiques explicites et implicites',3,1,'shared'),(91,'FFTW','http://www.fftw.org/',1,'FFTW is a C subroutine library for computing the discrete Fourier transform (DFT) in one or more dimensions, of arbitrary input size, and of both real and complex data (as well as of even/odd data, i.e. the discrete cosine/sine transforms or DCT/DST). We believe that FFTW, which is free software, should become the FFT library of choice for most applications. ',3,1,'shared'),(92,'Octave','https://www.gnu.org/software/octave/',1,'GNU Octave est un logiciel libre de calcul numérique comparable ŕ MATLAB et ŕ Scilab. Ce n\'est pas un logiciel de calcul formel. Le logiciel est développé puis maintenu pour le projet GNU par John W. Eaton.',3,1,'shared'),(93,'Normaliz','https://www.normaliz.uni-osnabrueck.de/',1,'Normaliz is an open source tool for computations in affine monoids, vector configurations, lattice polytopes, and rational cones. The variant QNormaliz now computes algebraic polyhedra, i.e., polyhedra defined over real algebraic extensions of Q.',3,1,'shared'),(94,'LAPACK','http://www.netlib.org/lapack/',1,'LAPACK is written in Fortran 90 and provides routines for solving systems of simultaneous linear equations, least-squares solutions of linear systems of equations, eigenvalue problems, and singular value problems. The associated matrix factorizations (LU, Cholesky, QR, SVD, Schur, generalized Schur) are also provided, as are related computations such as reordering of the Schur factorizations and estimating condition numbers. Dense and banded matrices are handled, but not general sparse matrices. In all areas, similar functionality is provided for real and complex matrices, in both single and double precision.',3,1,'shared'),(95,'BLAS','http://www.netlib.org/blas/',1,'The BLAS (Basic Linear Algebra Subprograms) are routines that provide standard building blocks for performing basic vector and matrix operations. The Level 1 BLAS perform scalar, vector and vector-vector operations, the Level 2 BLAS perform matrix-vector operations, and the Level 3 BLAS perform matrix-matrix operations. Because the BLAS are efficient, portable, and widely available, they are commonly used in the development of high quality linear algebra software, LAPACK for example.',3,1,'shared'),(96,'OpenBLAS','https://www.openblas.net/',1,'OpenBLAS is an optimized BLAS library based on GotoBLAS2 1.13 BSD version',3,1,'shared'),(97,'BLACS','https://www.netlib.org/blacs/',1,'he BLACS (Basic Linear Algebra Communication Subprograms) project is an ongoing investigation whose purpose is to create a linear algebra oriented message passing interface that may be implemented efficiently and uniformly across a large range of distributed memory platforms. ',3,1,'shared'),(98,'Eigen3','http://eigen.tuxfamily.org/index.php?title=Main_Page',1,'Eigen is a C++ template library for linear algebra: matrices, vectors, numerical solvers, and related algorithms.',3,1,'shared'),(99,'ACML','https://developer.amd.com/tools-and-sdks/cpu-development/cpu-libraries/amd-core-math-library-acml/',1,'ACML provides a free set of thoroughly optimized and threaded math routines for HPC, scientific, engineering and related compute-intensive applications. ACML is ideal for weather modeling, computational fluid dynamics, financial analysis, oil and gas applications and more.',3,1,'shared'),(100,'ELPA','https://gitlab.mpcdf.mpg.de/elpa/elpa',1,' Eigenvalue SoLvers for Petaflop-Applications (ELPA) The publicly available ELPA library provides highly efficient and highly scalable direct eigensolvers for symmetric matrices. Though especially designed for use for PetaFlop/s applications solving large problem sizes on massively parallel supercomputers,  ELPA eigensolvers have proven to be also very efficient for smaller matrices.',3,1,'shared'),(101,'HPL','https://www.netlib.org/benchmark/hpl/copyright.html',1,'HPL is a software package that solves a (random) dense linear system in double precision (64 bits) arithmetic on distributed-memory computers. It can thus be regarded as a portable as well as freely available implementation of the High Performance Computing Linpack Benchmark.',3,1,'shared'),(102,'WRF','http://www2.mmm.ucar.edu/wrf/OnLineTutorial/compilation_tutorial.php http://www2.mmm.ucar.edu/wrf/OnLineTutorial/Introduction/start.php',0,'The Weather Research and Forecasting (WRF) Model is a next-generation mesoscale numerical weather prediction system designed to serve both operational forecasting and atmospheric research needs. It features multiple dynamical cores, a 3-dimensional variational (3DVAR) data assimilation system, and a software architecture allowing for computational parallelism and system extensibility. WRF is suitable for a broad spectrum of applications across scales ranging from meters to thousands of kilometers.',5,1,'shared'),(103,'RegCM','https://gforge.ictp.it/gf/project/regcm/',0,'The Regional Climate Model system RegCM is maintained in the Earth System Physics (ESP) section of the ICTP. The latest version of the model, RegCM4, includes major upgrades in the structure of the code and its pre- and post- processors, along with the inclusion of some new physics parameterizations. The model is flexible, portable and easy to use. It can be applied to any region of the World, with grid spacing of up to about 10 km (hydrostatic limit), and for a wide range of studies, from process studies to paleoclimate and future climate simulation.',5,1,'shared'),(104,'Chimere','http://www.lmd.polytechnique.fr/chimere/',0,'Chimere is A multi-scale chemistry-transport model for atmospheric composition analysis and forecast',5,1,'shared'),(105,'gmt','http://gmt.soest.hawaii.edu/projects/gmt/wiki/Installing',0,'The Generic Mapping Tools, GMT, are an open source collection of tools for manipulating geographic and Cartesian data sets (including filtering, trend fitting, gridding, projecting, etc.) and producing PostScript illustrations ranging from simple x?y plots via contour maps to artificially illuminated surfaces and 3D perspective views. It is released under the GNU Lesser General Public License',5,1,'shared'),(106,'CRYSTAL','http://www.crystal.unito.it/index.php',0,'The CRYSTAL package performs ab initio calculations of the ground state energy, energy gradient, electronic wave function and properties of periodic systems. Hartree-Fock or KohnSham Hamiltonians (that adopt an Exchange-Correlation potential following the postulates of Density-Functional Theory) can be used. Systems periodic in 0 (molecules, 0D), 1 (polymers, 1D), 2 (slabs, 2D), and 3 dimensions (crystals, 3D) are treated on an equal footing. In each case the fundamental approximation made is the expansion of the single particle wave functions (?Crystalline Orbital?, CO) as a linear combination of Bloch functions (BF) defined in terms of local functions (hereafter indicated as ?Atomic Orbitals?, AOs). ',2,1,'shared'),(107,'GULP ','http://gulp.curtin.edu.au/gulp/request.cfm?rel=download',0,'GULP is a program for performing a variety of types of simulation on materials using boundary conditions of 0-D (molecules and clusters), 1-D (polymers), 2-D (surfaces, slabs and grain boundaries), or 3-D (periodic solids). The focus of the code is on analytical solutions, through the use of lattice dynamics, where possible, rather than on molecular dynamics. A variety of force fields can be used within GULP spanning the shell model for ionic materials, molecular mechanics for organic systems, the embedded atom model for metals and the reactive REBO potential for hydrocarbons. Analytic derivatives are included up to at least second order for most force fields, and to third order for many.',2,3,'shared'),(108,'GAMIT/GLOBK','http://geoweb.mit.edu/gg/',0,'GAMIT, GLOBK and TRACK form a comprehensive suite of programs for analyzing GNSS measurements primarily to study crustal deformation. ',5,3,'shared'),(109,'GIPSYX-OASIS','https://gipsy-oasis.jpl.nasa.gov',0,'GIPSY-OASIS, or GIPSY, is the GNSS-Inferred Positioning System and Orbit Analysis Simulation Software package. GIPSY is developed by the Jet Propulsion Laboratory (JPL), and maintained by the Near Earth Tracking Applications and Systems groups. ',5,2,'shared'),(110,'MCNP or MCNPX','https://laws.lanl.gov/vhosts/mcnp.lanl.gov/index.shtml',0,'Monte Carlo N-Particle eXtended (MCNPX) was also developed at Los Alamos National Laboratory, and is capable of simulating particle interactions of 34 different types of particles (nucleons and ions) and 2000+ heavy ions at nearly all energies,[3] including those simulated by MCNP.',1,2,'shared'),(111,'Fluka','http://www.fluka.org',0,'FLUKA is a fully integrated particle physics MonteCarlo simulation package. It has many applications in high energy experimental physics and engineering, shielding, detector and telescope design, cosmic ray studies, dosimetry, medical physics and radio-biology. ',2,3,'shared'),(112,'tecplot','https://www.tecplot.com/',0,'Tecplot software helps engineers and scientists discover, analyze, and understand information in complex data. Whether performing simulations, analyses or experiments, data visualization provides insight and understanding hidden inside your data. This information can be critical in pinpointing and solving problems, optimizing designs, and in explaining physical observations. ',7,2,'shared'),(113,'Matlab','https://fr.mathworks.com/products/matlab.html',0,'MATLAB (matrix laboratory) is a multi-paradigm numerical computing environment and proprietary programming language developed by MathWorks. MATLAB allows matrix manipulations, plotting of functions and data, implementation of algorithms, creation of user interfaces, and interfacing with programs written in other languages, including C, C++, C#, Java, Fortran and Python.',3,2,'shared'),(114,'Java','https://www.java.com',1,'Java is a general-purpose programming language that is class-based, object-oriented,[15] and designed to have as few implementation dependencies as possible. ',7,1,'shared'),(115,'Simulink','https://www.mathworks.com/products/simulink.html',0,'Simulink, developed by MathWorks, is a graphical programming environment for modeling, simulating and analyzing multidomain dynamical systems.',3,2,'shared'),(116,'Python','https://www.python.org/',1,'Python is an interpreted, high-level, general-purpose programming language. Created by Guido van Rossum and first released in 1991, Python\'s design philosophy emphasizes code readability with its notable use of significant whitespace.',7,1,'shared'),(117,'FreeFem++','https://freefem.org/',1,'FreeFEM is a popular 2D and 3D partial differential equations (PDE) solver used by thousands of researchers across the world. It allows you to easily implement your own physics modules using the provided FreeFEM language. FreeFEM offers a large list of finite elements, like the Lagrange, Taylor-Hood, etc., usable in the continuous and discontinuous Galerkin method framework.',1,1,'shared'),(118,'ANSYS ','https://www.ansys.com/',0,'ANSYS full suite of engineering simulation solutions enables CAD modeling and simulation for all design engineers.',1,2,'shared'),(119,'Apache Hadoop','https://hadoop.apache.org/',0,'Apache Hadoop ( /h??du?p/) is a collection of open-source software utilities that facilitate using a network of many computers to solve problems involving massive amounts of data and computation. It provides a software framework for distributed storage and processing of big data using the MapReduce programming model. ',8,1,'shared'),(120,'Comsol','https://www.comsol.fr/',0,'COMSOL Multiphysics is a cross-platform finite element analysis, solver and multiphysics simulation software. It allows conventional physics-based user interfaces and coupled systems of partial differential equations (PDEs). COMSOL provides an IDE and unified workflow for electrical, mechanical, fluid, and chemical applications. An API for Java and LiveLink for MATLAB may be used to control the software externally, and the same API is also used via the Method Editor.',1,2,'shared'),(121,'Gnuplot','http://www.gnuplot.info/',1,'Gnuplot is a portable command-line driven graphing utility for Linux, OS/2, MS Windows, OSX, VMS, and many other platforms.',7,1,'shared'),(122,'Abaqus','https://www.3ds.com/fr/produits-et-services/simulia/produits/abaqus/',0,'Abaqus FEA[4][5] (formerly ABAQUS) is a software suite for finite element analysis and computer-aided engineering, originally released in 1978. The name and logo of this software are based on the abacus calculation tool.',7,2,'shared'),(123,'ADF','https://www.scm.com/',0,'Amsterdam Density Functional (ADF) is a program for first-principles electronic structure calculations that makes use of density functional theory (DFT).',2,2,'shared'),(124,'Amber Tools','http://ambermd.org/AmberTools.php',0,'AmberTools consists of several independently developed packages that work well by themselves, and with Amber18 itself. The suite can also be used to carry out complete molecular dynamics simulations, with either explicit water or generalized Born solvent models.',2,3,'shared'),(125,'ArcGIS','https://www.esri.com/en-us/arcgis/about-arcgis/overview',0,'ArcGIS is a geographic information system (GIS) for working with maps and geographic information. It is used for creating and using maps, compiling geographic data, analyzing mapped information, sharing and discovering geographic information, using maps and geographic information in a range of applications, and managing geographic information in a database.',5,2,'shared'),(126,'UCSF Chimera','http://www.cgl.ucsf.edu/chimera/',0,'UCSF Chimera is a highly extensible program for interactive visualization and analysis of molecular structures and related data, including density maps, supramolecular assemblies, sequence alignments, docking results, trajectories, and conformational ensembles. ',4,1,'shared'),(127,'Code_aster','https://www.code-aster.org/V2/spip.php?rubrique2',1,'ode_Aster est un logiciel libre de simulation numrique en mcanique des structures, dvelopp principalement par le dpartement Ž Analyses Mcaniques et Acoustiques Ż du service recherche et dveloppement d\'EDF.',1,1,'shared'),(128,'DIRAC ','http://www.diracprogram.org/doku.php',1,'DIRAC: Program for Atomic and Molecular Direct Iterative Relativistic All-electron Calculations',2,1,'shared'),(129,'Discovery Studio','https://www.3dsbiovia.com/products/collaborative-science/biovia-discovery-studio/simulations.html',0,'Discovery Studio is a suite of software for simulating small molecule and macromolecule systems. It is developed and distributed by Accelrys.',2,2,'shared'),(130,'ENVI','https://www.harrisgeospatial.com/Software-Technology/ENVI',0,'ENVI image analysis software is used by GIS professionals, remote sensing scientists, and image analysts to extract meaningful information from imagery to make better decisions. ',5,2,'shared'),(131,'ERDAS','https://www.hexagongeospatial.com',0,'ERDASŠ IMAGINE 2018 performs advanced remote sensing analysis and spatial modeling to create new information that lets you visualize your results in 2D, 3D, movies, and on cartographic-quality map compositions. ',5,2,'shared'),(132,'GAMOS','http://fismed.ciemat.es/GAMOS/',1,'GAMOS is a GEANT4-based framework that is at the same time easy-to-use and flexible.',1,1,'shared'),(133,'Glide','https://www.schrodinger.com/glide',0,'Glide offers the full spectrum of speed and accuracy from high-throughput virtual screening of millions of compounds to extremely accurate binding mode',5,2,'shared'),(134,'Jupyter Notebook','https://jupyter.org/',1,'The Jupyter Notebook is an open-source web application that allows you to create and share documents that contain live code, equations, visualizations and narrative text. Uses include: data cleaning and transformation, numerical simulation, statistical modeling, data visualization, machine learning, and much more.',7,1,'local'),(135,'Maestro ','https://www.schrodinger.com/maestro',0,'Schrdinger is the scientific leader in developing state-of-the-art chemical simulation software for use in pharmaceutical, biotechnology, and materials science research. Maestro is the portal to all of Schrdinger\'s computational technology ? far more than just a user interface, Maestro also helps researchers organize and analyze data.',2,2,'shared'),(136,'MOLECULAR OPERATING ENVIRONMENT','https://www.chemcomp.com/Products.htm',0,'Integrated computer-aided molecular design platform for small molecule and biological therapeutics. ',2,2,'shared'),(137,'NLTK','https://www.nltk.org/',0,'NLTK is a leading platform for building Python programs to work with human language data. It provides easy-to-use interfaces to over 50 corpora and lexical resources such as WordNet, along with a suite of text processing libraries for classification, tokenization, stemming, tagging, parsing, and semantic reasoning, wrappers for industrial-strength NLP libraries, and an active discussion forum.',6,1,'shared'),(139,'OpenFOAM','https://www.openfoam.com/',1,'OpenFOAM (for \"Open source Field Operation And Manipulation\"\") is a C++ toolbox for the development of customized numerical solvers',0,0,'1'),(140,'Pandas','https://pandas.pydata.org/',0,'pandas is an open source, BSD-licensed library providing high-performance, easy-to-use data structures and data analysis tools for the Python programming language.',7,1,'shared'),(141,'PyCharm','https://www.jetbrains.com/pycharm/',0,'PyCharm is an integrated development environment (IDE) used in computer programming, specifically for the Python language. It is developed by the Czech company JetBrains.[6] It provides code analysis, a graphical debugger, an integrated unit tester, integration with version control systems (VCSes), and supports web development with Django.',7,1,'shared'),(142,'PyTorch','https://pytorch.org/',0,'PyTorch computer software, specifically an machine learning library for the programming language Python, based on the Torch library,[1][2][3] used for applications such as natural language processing.[4] It is primarily developed by Facebook\'s artificial-intelligence research group,[5][6][7] and Uber\'s Pyro probabilistic programming language software is built on it.[8] It is free and open-source software released under one of the BSD licenses.',6,1,'shared'),(143,'QGIS','https://qgis.org/en/site/',0,'QGIS (previously known as Quantum GIS) is a free and open-source cross-platform desktop geographic information system (GIS) application that supports viewing, editing, and analysis of geospatial data.[2]',5,1,'shared'),(144,'RapidMiner','https://rapidminer.com/',0,'RapidMiner is a data science software platform developed by the company of the same name that provides an integrated environment for data preparation, machine learning, deep learning, text mining, and predictive analytics.',9,2,'shared'),(145,'salome-meca','https://www.code-aster.org/spip.php?article295',0,' une plate-forme au service de la simulation mcanique',1,2,'shared'),(146,'SCIP','https://scip.zib.de/',0,'SCIP is currently one of the fastest non-commercial solvers for mixed integer programming (MIP) and mixed integer nonlinear programming (MINLP). It is also a framework for constraint integer programming and branch-cut-and-price. It allows for total control of the solution process and the access of detailed information down to the guts of the solver.',3,1,'shared'),(147,'SciPy  ','https://www.scipy.org/',1,'SciPy (pronounced ?Sigh Pie?) is a Python-based ecosystem of open-source software for mathematics, science, and engineering.',7,1,'shared'),(148,'Schrodinger','https://www.schrodinger.com/',0,'Schrdinger is the scientific leader in developing state-of-the-art chemical simulation software for use in pharmaceutical, biotechnology, and materials research.',2,2,'shared'),(149,'scikit-learn','https://scikit-learn.org/stable/',0,'Scikit-learn (formerly scikits.learn) is a free software machine learning library for the Python programming language.[3] It features various classification, regression and clustering algorithms including support vector machines, random forests, gradient boosting, k-means and DBSCAN, and is designed to interoperate with the Python numerical and scientific libraries NumPy and SciPy.',6,1,'shared'),(150,'SNAP','https://step.esa.int/main/toolboxes/snap/',0,'A common architecture for all Sentinel Toolboxes is being jointly developed by Brockmann Consult, Array Systems Computing and C-S called the Sentinel Application Platform (SNAP).',5,1,'shared'),(151,'SPSS','https://www.ibm.com/fr-fr/analytics/spss-statistics-software',0,'SPSS Statistics is a software package used for interactive, or batched, statistical analysis. Long produced by SPSS Inc., it was acquired by IBM in 2009. The current versions (2015) are named IBM SPSS Statistics.',7,2,'shared'),(152,'SYBYL-X','https://sybyl-x.software.informer.com',0,'SYBYL-X is a program that allows you to create molecular modeling from sequence through lead optimization. The program has capabilities for small molecule modeling and simulation, macromolecular modeling and simulation, cheminformatics and lead identification.',2,1,'shared'),(153,'Theano ','http://deeplearning.net/software/theano/',0,'Theano is a Python library and optimizing compiler for manipulating and evaluating mathematical expressions, especially matrix-valued ones.[2] In Theano, computations are expressed using a NumPy-esque syntax and compiled to run efficiently on either CPU or GPU architectures.',6,1,'shared'),(154,'Vasp','https://www.vasp.at/',0,'The Vienna Ab initio Simulation Package (VASP) is a computer program for atomic scale materials modelling, e.g. electronic structure calculations and quantum-mechanical molecular dynamics, from first principles.',2,2,'shared'),(155,'Weka','https://www.cs.waikato.ac.nz/ml/weka',0,'Weka is a collection of machine learning algorithms for data mining tasks. It contains tools for data preparation, classification, regression, clustering, association rules mining, and visualization.',6,1,'shared'),(156,'SOWFA','https://nwtc.nrel.gov/SOWFA',1,'SOWFA (Simulator fOr Wind Farm Applications) is a set of computational fluid dynamics (CFD) solvers, boundary conditions, and turbine models based on the OpenFOAM CFD toolbox.',1,1,'shared'),(158,'Abaqus2Matlab Toolbox - MATLAB','https://www.mathworks.com/matlabcentral/fileexchange/54919-abaqus2matlab',0,'Abaqus2Matlab is a program for the extraction of ABAQUS analysis results to MATLAB. It is an application which aims to provide a link between ABAQUS and MATLAB, which will enable ABAQUS users to perform postprocessing of ABAQUS results in MATLAB. It can be used to retrieve results from an ABAQUS analysis, which can be easily transferred from ABAQUS to MATLAB for further processing. It is written in MATLAB programming language and is available as source code distributed under a BSD-style license',7,1,'shared'),(159,'ADS','https://www.keysight.com/en/pc-1297113/advanced-design-system-ads?&cc=MA&lc=eng',0,'Advanced Design System (ADS) is an electronic design automation software system produced by Keysight EEsof EDA,[1] a division of Keysight Technologies. It provides an integrated design environment to designers of RF electronic products such as mobile phones,[2] pagers, wireless networks, satellite communications, radar systems, and high-speed data links.',1,2,'shared'),(160,'Android Studio','https://developer.android.com/studio',0,'Android Studio is the official integrated development environment for Google\'s Android operating system, built on JetBrains\' IntelliJ IDEA software and designed specifically for Android development. It is available for download on Windows, macOS and Linux based operating systems.',7,1,'shared'),(161,'ANSYS Fluent','https://www.ansys.com/products/fluids/ansys-fluent',0,'Fluent software contains the broad, physical modeling capabilities needed to model flow, turbulence, heat transfer and reactions for industrial applications. These range from air flow over an aircraft wing to combustion in a furnace, from bubble columns to oil platforms, from blood flow to semiconductor manufacturing and from clean room design to wastewater treatment plants. Fluent spans an expansive range, including special models, with capabilities to model in-cylinder combustion, aero-acoustics, turbomachinery and multiphase systems.',1,2,'shared'),(162,'Code Blocks','http://www.codeblocks.org/',0,'Code::Blocks is a free C, C++ and Fortran IDE built to meet the most demanding needs of its users. It is designed to be very extensible and fully configurable.',7,1,'shared'),(163,'CST Studio Suite','https://www.cst.com/products/cstmws',0,'(CST MICROWAVE STUDIO) is a specialist tool for the 3D EM simulation of high frequency components. The unparalleled performance from CST MWS makes it the first choice in leading R&D departments.',1,2,'shared'),(164,'Eclipse','https://www.eclipse.org/',0,'Eclipse is an integrated development environment used in computer programming, and in 2014 was the most widely used Java IDE in one website\'s poll. It contains a base workspace and an extensible plug-in system for customizing the environment.',7,1,'shared'),(165,'EvoSuite','http://www.evosuite.org/',0,'EvoSuite is a tool that automatically generates test cases with assertions for classes written in Java code. To achieve this, EvoSuite applies a novel hybrid approach that generates and optimizes whole test suites towards satisfying a coverage criterion. ',7,1,'shared'),(166,'Feko','https://altairhyperworks.com/product/FEKO',0,'FEKO is a computational electromagnetics software product developed by Altair Engineering. The name is derived from the German acronym \"FEldberechnung fr Krper mit beliebiger Oberflche\"\"',0,1,'2'),(167,'ANSYS HFSS','https://www.ansys.com/products/electronics/ansys-hfss',0,'HFSS is a commercial finite element method solver for electromagnetic structures from Ansys. The acronym stands for high-frequency structure simulator',1,2,'shared'),(168,'Matplotlib','https://matplotlib.org/',0,'Matplotlib is a Python 2D plotting library which produces publication quality figures in a variety of hardcopy formats and interactive environments across platforms. Matplotlib can be used in Python scripts, the Python and IPython shells, the Jupyter notebook, web application servers, and four graphical user interface toolkits.',7,1,'shared'),(169,'Nios II','https://www.intel.com/content/www/us/en/products/programmable/processor/nios-ii.html',0,'Nios II is a 32-bit embedded-processor architecture designed specifically for the Altera family of field-programmable gate array (FPGA) integrated circuits. Nios II incorporates many enhancements over the original Nios architecture, making it more suitable for a wider range of embedded computing applications, from digital signal processing (DSP) to system-control.',7,2,'shared'),(170,'Numax3','https://mumax.github.io/',0,'mumax3 is a GPU-accelerated micromagnetic simulation program developed at the DyNaMat group of Prof. Van Waeyenberge at Ghent University. The code is written and maintained by Arne Vansteenkiste.',1,1,'shared'),(171,'OpenCV ','https://opencv.org/',0,'OpenCV is a library of programming functions mainly aimed at real-time computer vision. Originally developed by Intel, it was later supported by Willow Garage then Itseez. The library is cross-platform and free for use under the open-source BSD license',7,1,'shared'),(172,'Optimization Toolbox - MATLAB','https://www.mathworks.com/products/optimization.html',0,'Optimization Toolbox? provides functions for finding parameters that minimize or maximize objectives while satisfying constraints. The toolbox includes solvers for linear programming (LP), mixed-integer linear programming (MILP), quadratic programming (QP), nonlinear programming (NLP), constrained linear least squares, nonlinear least squares, and nonlinear equations.',7,2,'shared'),(173,'Quartus','https://www.intel.com/content/www/us/en/software/programmable/quartus-prime/overview.html',0,'Intel Quartus Prime is programmable logic device design software produced by Intel; prior to Intel\'s acquisition of Altera the tool was called Altera Quartus II.',7,2,'shared'),(174,'Solidworks','https://www.solidworks.com/',0,'SolidWorks is a solid modeling computer-aided design and computer-aided engineering computer program that runs on Microsoft Windows. SolidWorks is published by Dassault Systmes.',7,2,'shared'),(175,'VAMPIRE','http://www.vampire-dynamics.com/',0,'VAMPIREŠ software allows the user to build a dynamic model of any rail vehicle and study the response of the vehicle to real measured track geometry or user specified inputs in the form of track displacements and external force inputs. Rail vehicles can be modelled with simulated instrumentation allowing almost any aspect of behaviour to be studied.',1,2,'shared'),(176,'Moltemplate','https://moltemplate.org/',0,'Moltemplate is a general cross-platform text-based molecule builder for LAMMPS. Moltemplate was designed for inventing new kinds of complex coarse-grained toy models of molecules, molecular machines, and assemblies. However it is well suited for preparing realistic all-atom simulations as well. It supports a wide variety of existing force fields including: OPLS, AMBER(GAFF,GAFF2), COMPASS, MARTINI, SDK, LOPLS(2015), EFF, and TraPPE(1998), however it can be used to build molecules using any of the force fields (and atom styles ) available in LAMMPS, including new force fields created by modifying the LAMMPS source code',2,1,'shared'),(177,'GATK','https://software.broadinstitute.org/gatk/',0,'Genome Analysis Toolkit:Developed in the Data Sciences Platform at the Broad Institute, the toolkit offers a wide variety of tools with a primary focus on variant discovery and genotyping. Its powerful processing engine and high-performance computing features make it capable of taking on projects of any size.',4,1,'shared'),(178,'TOIL','https://cgl.genomics.ucsc.edu/toil/',0,'Toil is a scalable, efficient, cross-platform (Linux & macOS) pipeline management system, written entirely in Python, and designed around the principles of functional programming.',4,1,'shared'),(179,'Nextflow Workbench','http://campagnelab.org/software/nextflow-workbench/',0,'The Nextflow Workbench is a set of languages developed with the Jetbrains MPS Language Workbench that make it easier to write data analysis workflows with Nextflow.',4,1,'shared'),(180,'MitoTool','http://www.mitotool.org/software.html',1,'MitoTool, a web-based bioinformatics platform, provides a convenient, user-friendly interface for handling human mtDNA sequence data. ',4,1,'shared'),(181,'QuTiP','http://qutip.org/',0,'QuTiP is open-source software for simulating the dynamics of open quantum systems. The QuTiP library depends on the excellent Numpy, Scipy, and Cython numerical packages. In addition, graphical output is provided by Matplotlib. QuTiP aims to provide user-friendly and efficient numerical simulations of a wide variety of Hamiltonians, including those with arbitrary time-dependence, commonly found in a wide range of physics applications such as quantum optics, trapped ions, superconducting circuits, and quantum nanomechanical resonators. ',1,1,'shared'),(182,'EnergyPlus','https://energyplus.net/',0,'EnergyPlus? is a whole building energy simulation program that engineers, architects, and researchers use to model both energy consumption?for heating, cooling, ventilation, lighting and plug and process loads?and water use in buildings.',1,3,'shared'),(183,'TRNSYS','https://sel.me.wisc.edu/trnsys/features/',0,'TRNSYS is a transient systems simulation program with a modular structure. It recognizes a system description language in which the user specifies the components that constitute the system and the manner in which they are connected. The TRNSYS library includes many of the components commonly found in thermal and electrical energy systems, as well as component routines to handle input of weather data or other time-dependent forcing functions and output of simulation results. ',1,2,'shared'),(184,'OpenStudio','https://www.openstudio.net/',0,'OpenStudioŠ is a cross-platform (Windows, Mac, and Linux) collection of software tools to support whole building energy modeling using EnergyPlus and advanced daylight analysis using Radiance. OpenStudio is an open source (LGPL) project to facilitate community development, extension, and private sector adoption. OpenStudio includes graphical interfaces along with a Software Development Kit (SDK).',1,3,'shared'),(185,'EGSnrc','https://nrc-cnrc.github.io/EGSnrc',1,'EGSnrc is a software toolkit to perform Monte Carlo simulation of ionizing radiation transport through matter. It models the propagation of photons, electrons and positrons with kinetic energies between 1 keV and 10 GeV, in homogeneous materials. ',1,1,'local'),(186,'BigInsights','https://www.ibm.com/support/knowledgecenter/SSPT3X_3.0.0/com.ibm.swg.im.infosphere.biginsights.product.doc/doc/c0057605.html',0,'InfoSphere BigInsights helps your organization to understand and analyze massive volumes of unstructured information as easily as smaller volumes of information. The flexible platform is built on an Apache Hadoop open source framework that runs in parallel on commonly available, low-cost hardware. You can easily scale the platform to analyze hundreds of terabytes, petabytes, or more of raw data that is derived from various sources. As information grows, you add more hardware to support the influx of data.',8,2,'shared'),(187,'Mathematica','https://www.wolfram.com/mathematica/',0,'Wolfram Mathematica is a modern technical computing system spanning most areas of technical computing ? including neural networks, machine learning, image processing, geometry, data science, visualizations, and others',3,2,'shared'),(188,'Namd','https://www.ks.uiuc.edu/Research//namd/',0,'Nanoscale Molecular Dynamics is computer software for molecular dynamics simulation, written using the Charm++ parallel programming model. It is noted for its parallel efficiency and is often used to simulate large systems.',2,3,'shared'),(189,'MOPAC','http://openmopac.net/',0,'MOPAC (Molecular Orbital PACkage) is a semiempirical quantum chemistry program based on Dewar and Thiel\'s NDDO approximation. ',2,1,'shared'),(190,'OpenNMT','http://opennmt.net/',0,'OpenNMT is an open source ecosystem for neural machine translation and neural sequence learning.',6,1,'shared'),(191,'WSO2','https://wso2.com/',0,'WSO2 is an open-source technology provider founded in 2006. It offers an enterprise platform for integrating application programming interfaces, applications, and web services locally and across the Internet.',10,1,'shared'),(192,'Siddhi','https://siddhi.io/',0,'Fully open source, cloud native, scalable, streaming, and complex event processing system capable of building event-driven applications for real-time analytics, data integration, notification, and adaptive decision-making usecases',10,1,'shared'),(193,'Paraview','https://www.paraview.org/',1,'ParaView is an open-source multiple-platform application for interactive, scientific visualization. It has a client?server architecture to facilitate remote visualization of datasets, and generates level of detail models to maintain interactive frame rates for large datasets.',7,1,'shared'),(194,'Maple','https://www.maplesoft.com/',0,'Maple is math software that combines the world\'s most powerful math engine with an interface that makes it extremely easy to analyze, explore, visualize, and solve mathematical problems.',3,2,'shared'),(195,'Perl','https://www.perl.org/',1,'Perl is a highly capable, feature-rich programming language with over 30 years of development. Perl runs on over 100 platforms from portables to mainframes and is suitable for both rapid prototyping and large scale development projects.',7,1,'shared'),(196,'2HDMC','https://2hdmc.hepforge.org/',0,'2HDMC is a general-purpose calculator for the two-Higgs doublet model. It allows parametrization of the Higgs potential in many different ways, convenient specification of generic Yukawa sectors, the evaluation of decay widths (including higher-order QCD corrections), theoretical constraints and much more.',1,1,'shared'),(197,'HiggsBounds','https://gitlab.com/higgsbounds/higgsbounds/-/tree/5.9.1',0,'HiggsBounds takes a selection of Higgs sector predictions for any particular model as input and then uses the experimental topological cross section limits from Higgs searches at LEP, the Tevatron and the LHC to determine if this parameter point has been excluded at 95% C.L..',1,1,'shared'),(198,'HiggsSignals','https://gitlab.com/higgsbounds/higgssignals/-/tree/2.6.0',0,'HiggsSignals performs a statistical test of the Higgs sector predictions of arbitrary models (using the HiggsBounds input routines) with the measurements of Higgs boson signal rates and masses from the Tevatron and the LHC.',1,1,'shared'),(199,'ENDF/B-VII.1','https://www.nndc.bnl.gov/endf/b7.1/',0,'The ENDF/B-VII.1 library, released December 22, 2011, is the latest recommended evaluated nuclear data file for use in nuclear science and technology applications, and incorporates advances made in the five years since the release of ENDF/B-VII.0, including: many new evaluation in the neutron sublibrary (423 in all) and over 190 of these contain covariances, new fission product yields and a greatly expanded decay data sublibrary.',1,1,'shared'),(200,'IDL','https://www.harrisgeospatial.com/Software-Technology/IDL',0,'IDL software is the trusted scientific programming language used across disciplines to create meaningful visualizations out of complex numerical data. From small-scale analysis programs to widely deployed applications, IDL provides the comprehensive computing environment you need to effectively get information from your data',5,2,'shared'),(201,'GSL','https://www.gnu.org/software/gsl/',1,'The GNU Scientific Library is a software library for numerical computations in applied mathematics and science. The GSL is written in C; wrappers are available for other programming languages.',7,1,'shared'),(202,'LHAPDF ','https://lhapdf.hepforge.org/',0,'LHAPDF is a general purpose C++ interpolator, used for evaluating PDFs from discretised data files.',7,1,'shared'),(203,'ELK','http://elk.sourceforge.net/',0,'an all-electron full-potential linearised augmented-plane wave (LAPW) code with many advanced features. Written originally at Karl-Franzens-Universitt Graz as a milestone of the EXCITING EU Research and Training Network, the code is designed to be as simple as possible so that new developments in the field of density functional theory (DFT) can be added quickly and reliably. ',1,1,'shared'),(204,'PRIMO project','https://www.primoproject.net/primo/main',0,'PRIMO is a computer software that simulates clinical linear accelerators (linacs) and estimates absorbed dose distributions in phantoms and computerized tomographies. It combines a graphical user interface with the general-purpose radiation transport Monte Carlo code PENELOPE and the fast Monte Carlo code DPM',1,3,'shared'),(205,'Kaldi ','https://kaldi-asr.org/doc/about.html',0,'Kaldi is a toolkit for speech recognition written in C++ and licensed under the Apache License v2.0. Kaldi is intended for use by speech recognition researchers. For more detailed history and list of contributors see History of the Kaldi project.',6,1,'shared'),(206,'OMNeT++','https://omnetpp.org/',0,'OMNeT++ is an extensible, modular, component-based C++ simulation library and framework, primarily for building network simulators.',10,1,'shared'),(207,'Sumo','https://sumo.dlr.de/',0,'\"Simulation of Urban MObility\"\" (Eclipse SUMO) is an open source',0,0,'10'),(208,'Cufflinks','https://github.com/santosjorge/cufflinks',0,'This library binds the power of plotly with the flexibility of pandas for easy plotting.',7,1,'shared'),(209,'MaSuRCA ','https://github.com/alekseyzimin/masurca',1,'The MaSuRCA (Maryland Super Read Cabog Assembler) genome assembly and analysis toolkit contains of MaSuRCA genome assembler, QuORUM error corrector for Illumina data, POLCA genome polishing software, Chromosome scaffolder, jellyfish mer counter, and MUMmer aligner. ',4,1,'shared'),(210,'VCFtools','https://vcftools.github.io/index.html',0,'VCFtools is a program package designed for working with VCF files, such as those generated by the 1000 Genomes Project. The aim of VCFtools is to provide easily accessible methods for working with complex genetic variation data in the form of VCF files.',4,1,'shared'),(211,'Psim','https://powersimtech.com/',0,'PSIM is an Electronic circuit simulation software package, designed specifically for use in power electronics and motor drive simulations but can be used to simulate any electronic circuit.',7,2,'shared'),(212,'Netlogo','https://ccl.northwestern.edu/netlogo',1,'NetLogo is a multi-agent programmable modeling environment. It is used by many hundreds of thousands of students, teachers, and researchers worldwide',7,1,'shared'),(213,'GPAW','https://wiki.fysik.dtu.dk/gpaw/install.html',1,'GPAW calculations are controlled through scripts written in the programming language Python. GPAW relies on the Atomic Simulation Environment (ASE), which is a Python package that helps us describe our atoms. The ASE package also handles molecular dynamics, analysis, visualization, geometry optimization and more.',2,1,'shared'),(214,'CloudSim','http://www.cloudbus.org/cloudsim/',0,'CloudSim: A Framework For Modeling And Simulation Of Cloud Computing Infrastructures And Services',10,1,'shared'),(215,'iFogSim','https://github.com/Cloudslab/iFogSim',0,'A Toolkit for Modeling and Simulation of Resource Management Techniques in Internet of Things, Edge and Fog Computing Environments',10,1,'shared'),(216,'IMSL Fortran Library ','https://www.imsl.com/products/imsl-fortran-libraries',0,'IMSL Fortran Numerical Library provides the essential building blocks needed to develop analytic tools for your organization',7,2,'shared'),(217,'HFBTHO','https://doi.org/10.1016/j.cpc.2017.06.022',0,'HFBRHO is a physics computer code that is used to model the structure of the nucleus. It is an implementation of the nuclear energy Density Functional Theory (DFT), where the energy of the nucleus is obtained by integration over space of some phenomenological energy density, which is itself a functional of the neutron and proton densities. ',1,3,'shared'),(218,'DIRHB ','https://doi.org/10.1016/j.cpc.2014.02.027',0,'The DIRHB package consists of three Fortran computer codes for the calculation of the ground-state properties of even-even atomic nuclei using the framework of relativistic self-consistent mean-field models. Each code corresponds to a particular choice of spatial symmetry: the DIRHBS, DIRHBZ and DIRHBT codes are used to calculate nuclei with spherical symmetry, axially symmetric quadrupole deformation, and triaxial quadrupole shapes, respectively. ',1,3,'shared'),(219,'FROGS','https://github.com/geraldinepascal/FROGS',1,'FROGS is a CLI workflow designed to produce an OTU count matrix from high depth sequencing amplicon data.',4,1,'shared'),(220,'PyMol','https://pymol.org/2/',0,'PyMOL is a user-sponsored molecular visualization system on an open-source foundation, maintained and distributed by Schrdinger.',4,1,'shared'),(221,'Towhee','http://towhee.sourceforge.net/code/code_manual.html',1,'Towhee is a Monte Carlo molecular simulation code originally designed for the prediction of fluid phase equilibria using atom-based force fields and the Gibbs ensemble with particular attention paid to algorithms addressing molecule conformation sampling. The code has subsequently been extended to several ensembles, many different force fields, and solid (or at least porous) phases.',2,1,'shared'),(222,'Dl-poly','https://www.scd.stfc.ac.uk/Pages/DL_POLY.aspx',1,'DL_POLY is a general purpose classical molecular dynamics (MD) simulation software developed at Daresbury Laboratory by I.T. Todorov and W. Smith.',2,3,'shared'),(223,'PENELOPE','https://www.oecd-nea.org/lists/penelope.html',0,'PENELOPE performs Monte Carlo simulation of coupled electron-photon transport in arbitrary materials and complex quadric geometries. A mixed procedure is used for the simulation of electron and positron interactions (elastic scattering, inelastic scattering and bremsstrahlung emission) in which \'hard\' events (i.e. those with deflection angle and/or energy loss larger than pre-selected cut-offs) are simulated in a detailed way, while \'soft\' interactions are calculated from multiple scattering approaches. Photon interactions (Rayleigh scattering, Compton scattering, photoelectric effect and electron-positron pair production) and positron annihilation are simulated in a detailed way, event by event.',1,3,'shared'),(225,'Julia','https://julialang.org/    -   https://github.com/JuliaLang/julia',0,'Julia is a high-level, high-performance dynamic language for technical computing.',7,1,'shared'),(227,'WRF-CHEM','https://www2.acom.ucar.edu/wrf-chem',0,'WRF-Chem is the Weather Research and Forecasting (WRF) model coupled with Chemistry. The model simulates the emission, transport, mixing, and chemical transformation of trace gases and aerosols simultaneously with the meteorology. The model is used for investigation of regional-scale air quality, field program analysis, and cloud-scale interactions between clouds and chemistry.',1,1,'shared'),(228,'Scaps-1D','https://scaps.elis.ugent.be/',0,'SCAPS (a Solar Cell Capacitance Simulator) is a one dimensional solar cell simulation programme developed at the',1,1,'shared'),(229,'Termo PW','https://dalcorso.github.io/thermo_pw/',1,'Thermo_pw is a set of Fortran drivers for the parallel and/or automatic computation of materials properties using Quantum ESPRESSO (QE) routines as the underlying engine. It provides an alternative organization of the QE work-flow for the most common tasks exploiting, when possible, an asynchronous image parallelization. Moreover, the code has a set of pre-processing tools to reduce the input information given by the user and a set of post-processing tools to produce plots directly comparable with experiment.',1,2,'shared'),(230,'Fortran','https://fortran-lang.org/',1,'Fortran is a computer programming language that is extensively used in numerical, scientific computing. While outwith the scientific community, Fortran has declined in popularity over the years, it still has a strong user base with scientific programmers, and is also used in organisations such as weather forecasters, financial trading, and in engineering simulations. Fortran programs can be highly optimised to run on high performance computers, and in general the language is suited to producing code where performance is important.',3,1,'shared'),(231,'SageMath','https://www.sagemath.org/',0,'SageMath is a free open-source mathematics software system licensed under the GPL. It builds on top of many existing open-source packages: NumPy, SciPy, matplotlib, Sympy, Maxima, GAP, FLINT, R and many more. Access their combined power through a common, Python-based language or directly via interfaces or wrappers.',3,1,'shared'),(232,'SuperIso','http://superiso.in2p3.fr/download/',0,'SuperIso is a program for calculation of flavour physics observables in the Standard Model (SM), general two-Higgs-doublet model (2HDM), minimal supersymmetric Standard Model (MSSM) and next to minimal supersymmetric Standard Model (NMSSM). SuperIso, in addition to the isospin asymmetry of B -> K* gamma, which was the main purpose of the first version, incorporates other flavour observables such as the branching ratio of B -> Xs gamma at NNLO, the branching ratio of Bs -> mu+ mu-, the branching ratio of B -> tau nu, the branching ratio of B -> D tau nu, the branching ratio of K -> mu nu as well as the branching ratios of Ds -> tau nu and Ds -> mu nu, and many observables from the B -> Xs l+ l- and B -> K* mu+ mu- decays. It also computes the muon anomalous magnetic moment (g-2).',1,1,'shared'),(233,'Sushi','https://sushi.hepforge.org/downloads/',0,'usHi (Supersymmetric Higgs) is a Fortran code, which calculates Higgs cross sections',1,1,'shared'),(234,'MadGraph','https://launchpad.net/mg5amcnlo',0,'MadGraph5_aMC@NLO is a framework that aims at providing all the elements necessary for SM and BSM phenomenology, such as the computations of cross sections, the generation of hard events and their matching with event generators, and the use of a variety of tools relevant to event manipulation and analysis. Processes can be simulated to LO accuracy for any user-defined Lagrangian, an the NLO accuracy in the case of models that support this kind of calculations -- prominent among these are QCD and EW corrections to SM processes. Matrix elements at the tree- and one-loop-level can also be obtained.',1,1,'shared'),(235,'MadAnalysis','https://launchpad.net/madanalysis5',0,'MadAnalysis 5 is a framework for phenomenological investigations at particle colliders. Based on a C++ kernel, this program allows to efficiently perform, in a straightforward and user-friendly fashion, sophisticated physics analyses of event files such as those generated by a large class of Monte Carlo event generators.',1,1,'shared'),(236,'NumPy','https://numpy.org/',0,'NumPy est une bibliothque pour langage de programmation Python, destine  manipuler des matrices ou tableaux multidimensionnels ainsi que des fonctions mathmatiques oprant sur ces tableaux.',7,1,'shared'),(237,'Mapnik','https://mapnik.org/',0,'mapnik combines pixel-perfect image output with lightning-fast cartographic algorithms, and exposes interfaces in C++, Python, and Node.',7,1,'shared'),(238,'Google Earth','https://www.google.com/intl/fr/earth/ ',0,'Google Earth est un logiciel dvelopp par la socit Google, permettant une visualisation de la Terre avec un assemblage de photographies ariennes ou satellitaires. Anciennement produit par Keyhole inc., alors d\'accs payant, ce logiciel permet  tout utilisateur de survoler la Terre et de zoomer sur un lieu de son choix. Selon les rgions gographiques, les informations disponibles sont plus ou moins prcises. Ainsi un habitant d\'une mtropole peut localiser son restaurant prfr, obtenir une vue en 3D des immeubles de la mtropole, alors que la rsolution des photos d\'une bonne partie de la Terre est trs faible. La modlisation en trois dimensions des constructions, initialement ralise  l\'aide du logiciel SketchUp, est maintenant cre automatiquement  l\'aide d\'algorithmes utilisant pour une part les prises de vues Street View et des donnes d\'altitude. ',7,1,'shared'),(239,'Autoconf','https://www.gnu.org/software/autoconf/autoconf.html',1,'',7,1,'shared'),(240,'Automake','https://www.gnu.org/software/automake/',1,'',7,1,'shared'),(241,'Autotools','https://www.gnu.org/software/software.html',1,'',7,1,'shared'),(242,'Bazel','https://docs.bazel.build/versions/master/bazel-overview.html',1,'',7,1,'shared'),(243,'CLHEP','https://proj-clhep.web.cern.ch/proj-clhep/',1,'',1,1,'shared'),(244,'Dbus','https://www.freedesktop.org/wiki/Software/dbus/',1,''